// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Certificate {
    address public issuer;

    struct CertificateData {
        string studentName;
        string subject;
        string ipfsHash;
        address issuedTo;
    }

    mapping(address => CertificateData[]) public certificates;

    modifier onlyIssuer() {
        require(msg.sender == issuer, "Not authorized");
        _;
    }

    constructor(address _issuer) {
        issuer = _issuer;
    }

    function issueCertificate(
        address _student,
        string memory _name,
        string memory _subject,
        string memory _ipfsHash
    ) public onlyIssuer {
        certificates[_student].push(
            CertificateData(_name, _subject, _ipfsHash, _student)
        );
    }

    function getCertificates(address _student) public view returns (CertificateData[] memory) {
        return certificates[_student];
    }
}
